import React, { Component } from 'react';
import { useParams } from "react-router-dom";
import axios from 'axios'
import Map from '../components/MapTest'
import Marks from '../components/Marks'

export default class Region extends Component {
    state = {
        reg: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/regiones')
            .then(res => {
                const reg = res.data;
                this.setState({ reg });
            })
    }

    render() {
        const { reg } = this.state
        return (
            <div>
                <Use
                    list={reg}
                />
            </div>
        )
    }
}


function Use(props) {
    let { id } = useParams();
    const zoomR = 13
    const heightR = 500

    return (

        <div>
            {props.list.map(item => {
                if (id == item.region_id) {
                    return (
                        <div key={item.region_id}>
                            <Map
                                position={item.coordenadasR}
                                zoom={zoomR}
                                height={heightR}
                            />
                        </div>
                    )
                }
            })}
        </div>  
    );
}
